INSERT INTO `briliantmax_blog_` (`id`, `title`, `date`, `post`) VALUES
(1, 'Produksi Terbaru PT. BriliantMax', '2019-01-14', '<p style=\"text-align: justify;\">&nbsp;Agar dicapai produktivitas mesin &nbsp;yang lebih baik PT. Briliantmax Indonesia hadir menawarkan segala macam &nbsp;jenis mesin second untuk industri percetakan, penyediaan material cetak, &nbsp;jasa konsultasi dan reparasi mekanik dan electric di perusahaan.</p>\r\n\r\n<p style=\"text-align: justify;\">\r\n	<br>\r\n</p>\r\n\r\n<p style=\"text-align: justify;\">Agar dicapai produktivitas mesin &nbsp;yang lebih baik PT. Briliantmax &nbsp;Indonesia hadir menawarkan segala macam &nbsp;jenis mesin second untuk &nbsp;industri percetakan, penyediaan material cetak, &nbsp;jasa konsultasi dan &nbsp;reparasi mekanik dan electric di perusahaan.</p>\r\n\r\n<p style=\"text-align: justify;\">Agar dicapai produktivitas mesin &nbsp;yang lebih baik PT. Briliantmax &nbsp;Indonesia hadir menawarkan segala macam &nbsp;jenis mesin second untuk &nbsp;industri percetakan, penyediaan material cetak, &nbsp;jasa konsultasi dan &nbsp;reparasi mekanik dan electric di perusahaan.</p>\r\n\r\n<p style=\"text-align: justify;\">Agar dicapai produktivitas mesin &nbsp;yang lebih baik PT. Briliantmax &nbsp;Indonesia hadir menawarkan segala macam &nbsp;jenis mesin second untuk &nbsp;industri percetakan, penyediaan material cetak, &nbsp;jasa konsultasi dan &nbsp;reparasi mekanik dan electric di perusahaan.</p>\r\n\r\n<p style=\"text-align: justify;\">Agar dicapai produktivitas mesin &nbsp;yang lebih baik PT. Briliantmax &nbsp;Indonesia hadir menawarkan segala macam &nbsp;jenis mesin second untuk &nbsp;industri percetakan, penyediaan material cetak, &nbsp;jasa konsultasi dan &nbsp;reparasi mekanik dan electric di perusahaan.\r\n	<br>\r\n</p>'),
(3, 'About October CMS', '2019-01-16', '<p style=\"text-align: justify;\"><strong>October</strong> is a free, <a href=\"https://en.wikipedia.org/wiki/Open-source_software\" title=\"Open-source software\">open-source</a> and self-hosted <a href=\"https://en.wikipedia.org/wiki/Content_management_system\" title=\"Content management system\">content management system</a> (CMS) based on the <a href=\"https://en.wikipedia.org/wiki/PHP\" title=\"PHP\">PHP</a> programming language and <a href=\"https://en.wikipedia.org/wiki/Laravel\" title=\"Laravel\">Laravel</a>\r\n	<a href=\"https://en.wikipedia.org/wiki/Web_application_framework\" title=\"Web application framework\">web application framework</a>. It supports <a href=\"https://en.wikipedia.org/wiki/MySQL\" title=\"MySQL\">MySQL</a>, <a href=\"https://en.wikipedia.org/wiki/SQLite\" title=\"SQLite\">SQLite</a> and <a href=\"https://en.wikipedia.org/wiki/PostgreSQL\" title=\"PostgreSQL\">PostgreSQL</a> for the database backend and uses a <a href=\"https://en.wikipedia.org/wiki/Flat_file_database\" title=\"Flat file database\">flat file database</a> for the <a href=\"https://en.wikipedia.org/wiki/Front_end_development\" title=\"Front end development\">front end</a> structure.<sup><a href=\"https://en.wikipedia.org/wiki/October_(CMS)#cite_note-3\">[3]</a></sup> October is more widely used, and growing at a faster rate, than both of its leading flat-file CMS competitors (<a href=\"https://en.wikipedia.org/wiki/Jekyll_(software)\" title=\"Jekyll (software)\">Jekyll</a> and <a href=\"https://en.wikipedia.org/wiki/Grav\" title=\"Grav\">Grav</a>) <em>combined</em> as of March 2018.<sup><a href=\"https://en.wikipedia.org/wiki/October_(CMS)#cite_note-4\">[4]</a></sup></p>\r\n\r\n<p style=\"text-align: justify;\">October is conceived as a \"back to basics\" web platform that &nbsp;makes website creation, design, and editing faster and more intuitive. &nbsp;The October CMS covers an extensive range of capabilities such as users, &nbsp;permissions, and plugins; it can be utilized to build everything from &nbsp;simple promotional sites to powerful web applications. October supports &nbsp;the use of themes.<sup><a href=\"https://en.wikipedia.org/wiki/October_(CMS)#cite_note-5\">[5]</a></sup></p>\r\n\r\n<p style=\"text-align: justify;\">The platform is generally favoured among developers<sup><a href=\"https://en.wikipedia.org/wiki/October_(CMS)#cite_note-6\">[6]</a></sup><sup><a href=\"https://en.wikipedia.org/wiki/October_(CMS)#cite_note-7\">[7]</a></sup> for having a small learning curve and its unique template system that is easily manageable with <a href=\"https://en.wikipedia.org/wiki/Revision_control\" title=\"Revision control\">version control</a> systems.<sup><a href=\"https://en.wikipedia.org/wiki/October_(CMS)#cite_note-8\">[8]</a></sup> As of March 2018, October is the second-most starred PHP CMS repository hosted on <a href=\"https://en.wikipedia.org/wiki/GitHub\" title=\"GitHub\">GitHub</a>.<sup><a href=\"https://en.wikipedia.org/wiki/October_(CMS)#cite_note-9\">[9]</a></sup></p>\r\n\r\n<p style=\"text-align: justify;\">October is used as a primary CMS platform by studios who have &nbsp;world-famous brands in their portfolios, such as Toyota, KFC and Nestle. &nbsp;The Dallas Museum of Art uses October CMS in their information kiosks. &nbsp;Many of October users are located in United States and Russia &nbsp;furthermore in Europe: Switzerland, France, Netherlands, United Kingdom &nbsp;and other countries.</p>');

