(2, 'Material Cetak', '<p>Penyedia material cetak seperti Paper, PS-Positive Plate, Blanket, Blanket Cleaner, Eggopast, Eggolan, Fountain Solution, Plate Cleaner, Ink, Positive Developer, Corrector, Sponge, New Moll, RWA, ABC Wash, Perfect Gum, Bucerin Rwa, Spray Powder, Isopropile Alkohol.</p>'),
